 async (
  page: Page
): Promise<{ captchas: CaptchaInfo[] }> => {
  try {
    let recaptchaResult = await page.findRecaptchas();
    const { captchas } = recaptchaResult;
    return { captchas };
  } catch (e: Error | any) {
    console.log("isCaptchaExist Error", e?.message);
    return { captchas: [] };
  }
}
